import React from 'react';
import Inicio from './Plantilla';
import './../App.css';
import axios from 'axios';
import { useState, useEffect } from 'react';

export default function Tienda() {
  const [data, setData] = useState([]);
  // const [valor1, setValor1] = ("");
  useEffect(() => {
    // Realizar la petición GET cuando el componente se monte
    axios.get('http://localhost:8080/api/prods')
      .then(response => {
        setData(response.data);
        // setValor1(e.target.value)
      })
      
      .catch(error => {
        console.error('Error al obtener los datos:', error);
      });
  }, []);

  return (
    <Inicio>
      {console.log(data)}
      <div className="container">
        <input className='buscador' placeholder='productos'/>
        <div className="cajas">
          {data.map((producto, i) => {
            <div className='caja'>{producto.nombre}</div>
          }) }
        </div>
        {/* <div className="cajas">
          <div className='caja'>{data[0].nombre}</div>
          <div className='caja'>Div 2</div>
          <div className='caja'>Div 3</div>
        </div>
        <div className="cajas">
          <div className='caja'>Div 4</div>
          <div className='caja'>Div 5</div>
          <div className='caja'>Div 6</div>
        </div> */}
      </div>
    </Inicio>
  )
}
